    uint256 newBuyMarketingFee,
    uint256 newBuyLiquidityFee,
    uint256 newSellMarketingFee,
    uint256 newSellLiquidityFee
) external {
    // Only the designated marketing wallet can adjust fee values
    require(msg.sender == marketingWallet, "Caller is not the marketing wallet");

    // Ensure each individual fee is below the hard-coded maximum (3)
    require(newBuyMarketingFee  < 3, "Invalid buy marketing fee");
    require(newBuyLiquidityFee  < 3, "Invalid buy liquidity fee");
    require(newSellMarketingFee < 3, "Invalid sell marketing fee");
    require(newSellLiquidityFee < 3, "Invalid sell liquidity fee");

    // Persist the updated fee configuration
    buyMarketingFee   = newBuyMarketingFee;
    buyLiquidityFee   = newBuyLiquidityFee;
    sellMarketingFee  = newSellMarketingFee;
    sellLiquidityFee  = newSellLiquidityFee;
}

